import { BrowserRouter as Router, Route } from "react-router-dom";
import { Switch } from "react-router";
import Landing from "./components/Landing";
function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" component={Landing} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
